import './App.css';

const serviceList = [
  'Internet',
  'Telewizja',
  'Abonament telefoniczny',
  'Dekoder 4K'
];

function App() {
  return (
    <div className="App">
      <div className="navbar">
        Kalkulator cen usług
      </div>

      <div className="service-selector">
        {serviceList.map((service, key) => {
          return (
            <p className={`serivce-selector__item`} key={key}>{service}</p>
          )
        })}
      </div>

      <div className="service-calculator">
        Wybrane usługi:

        Suma:
      </div>

      <div className="footer">
        Bartosz Wiecheć
      </div>
    </div>
  );
}

export default App;
